Express, Mongoose, db.findOne always returns same document<p>I am attempting a CRUD app with MEAN stack. I am using mongoose in Express to call to the MongoDB. I am using the FindOne function with a specified parameter, and it's always returning the same (incorrect) document.</p>

<p>I know I am connected to the correct database, since I get a document back from that collection, but it's always the same document, no matter what I pass as the parameter.</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>module.exports = mongoose.model('Player', playersSchema, 'players'); //in player.js

const Player = require('./model/players');

app.get('/api/player/:id', (req, res) =&gt;{
        Player.findOne({id: req.params.playerId},
            function(err, player) {
                if(err) {
                res.json(err);
                }
                else {
                res.json(player);
                }
            });
    });</code></pre>
</div>
</div>
</p>

<p>I have 3 separate "players", with three distinct "playerID" fields (38187361, 35167321, 95821442). I can use Postman to GET the following URL, for example:</p>

<p><a href="http://localhost:3000/api/player/anythingyouWantInHere" rel="nofollow noreferrer">http://localhost:3000/api/player/anythingyouWantInHere</a></p>

<p>and it will return 38187361, the first document. I've been over this website, many tutorials, and the Mongoose documentation and I can't see what I'm doing wrong..</p>

<p>I'd like to eventually find by playerId OR username OR email, but one hurdle at a time...</p>

