Faceted classification - Spring Data Mongo<p>I'm trying to build a faceted classification using Spring Data Mongo and I'm confused on how to use <code>Aggregation.facet</code> method.</p>

<p>As I'm trying to figure out how the thing work I'm using twice the same <code>FacetOperation</code> and I'm getting a <code>java.lang.IllegalArgumentException: Invalid reference 'producer.fundings'!</code>. This <code>FacetOperation</code> alone in the <code>Aggregation</code> works fine!</p>

<pre><code>FacetOperation fo1 = facet(
        unwind("producer.fundings"),
        project().and("producer.fundings.type").as("type").and("producer.fundings.acronym").as("name"),
        group("name", "type").count().as("count"),
        project("count").and("_id.name").as("name").and("_id.type").as("type").andExclude("_id")
    ).as("fundingAcronymFacet");

    FacetOperation fo2 = facet(
        unwind("producer.fundings"),
        project().and("producer.fundings.type").as("type").and("producer.fundings.acronym").as("name"),
        group("name", "type").count().as("count"),
        project("count").and("_id.name").as("name").and("_id.type").as("type").andExclude("_id")
    ).as("fundingNameFacet");

Aggregation agg = Aggregation.newAggregation(fo1,fo2);
AggregationResults&lt;FacetClassification&gt; groupResults = mongoTemplate.aggregate(agg, "observations", FacetClassification.class);
List&lt;FacetClassification&gt; facet = groupResults.getMappedResults();
</code></pre>

<p>So either I'm not using the facet method well and only one call is needed to create different facet. This would looks like how it is implemented in the MongoDB API: <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/facet/" rel="nofollow noreferrer">$facet (aggregation)</a>
Or I need to chain <code>facet</code> call to create the different facets of my classification and need to know what happens after the first call and why the exact same reference is not found.</p>

<p>The documentation only provides examples that create one facet and could'nt find any example elsewhere: <a href="https://docs.spring.io/spring-data/mongodb/docs/current/reference/html/#mongo.aggregation.facet" rel="nofollow noreferrer">Spring Data Mongo Faceted Classification</a>. </p>

<p>related to : <a href="https://stackoverflow.com/questions/53327613/using-multiple-facets-in-mongodb-spring-data">Using multiple facets in MongoDB Spring Data</a></p>

<p>Any help would be appreciated!</p>

