How to get the Populated values of a model in GraphqQL list without _id reference?<p>I have a Users model with some fields and reference to "Skills" model.</p>

<p>The models are look like this below</p>

<p>1.Users.js (users model)</p>

<pre><code> const mongoose = require('mongoose');
 const Schema = mongoose.Schema;

 const UsersSchema = new Scheam({
     name: { type : String },
     email: { type : String },
     address: { type : String },

     Skills: [{ type: mongoose.Schema.Types.ObjectId, ref: 'Skills' }],
 })

 module.exports = mongoose.model('Users', UsersSchema);
</code></pre>

<p>2.Skills Model</p>

<pre><code>const mongoose = require('mongoose')
const Schema = mongoose.Schema;

const SkillsSchema = new Schema({
   name : { type: String },
});

module.exports = mongoose.model('Skills', SkillsSchema);
</code></pre>

<p>I am creating the new user with dropdown menu of skills selection storing the id's of the skills in users model. </p>

<p>And getting the skills by populating the Users model like this in node js app.</p>

<pre><code>  export function getUser(req, res) {
     console.log('getUser');
     console.log('req.body',req.body);
     Users.findOne({_id: req.body.user_id}).populate('skills').exec(function(err, usr_doc){ 
       if(err) {
          res.json({
             status: 401,
             message: 'something went wrong!',
             err: err,
          });
       } else if (!err &amp;&amp; usr_doc != null) {
           res.json({
               status: 200,
               message: 'User details found!',
               data: {_id: usr_doc._id, skills: usr_doc.skills,name: usr_doc.name,token: usr_doc.token},
           })
       }
     })//Users.findOne end
  }
</code></pre>

<p>The above code is working fine for normal rest api.</p>

<p>Here I try to create the Same api using GraphQL server of express-graphql in Nodejs.</p>

<p>The code look like this.</p>

