       name: 'Users',
       fields: () =&gt; ({
            id: {type: GraphQLID},
            name: { type : GraphQLString },
            email: { type : GraphQLString },
            **skills: {
                type: new GraphQLList(SkillsType),
                resolve(parent, args){
                  //Here I need to know how to get the skills name of the users
                }
            }**
       })

   const SkillsType = new GraphQLObjectType({
       name: 'Skills',
       fields: () =&gt; ({
          name: { type : GraphQLString },
       })
   })    
</code></pre>

<p>At present I didn't use any reference id in skills model, only name. I want to get the skill names of the Users.</p>

<p>If i use the below, I am getting all of the skill names instead of user particular or populated skill names.</p>

<pre><code>   skills : {
     type: new GraphQLList(SkillsType),
        resolve(parent, args){
            return Skills.find({})
        } 
</code></pre>

